(2366,'Gambar lah manusia lengkap dari ujung kepala sampai ujung kakinya. Setelah digambar, silahkan gambarnya diberi nama, usia, jenis kelamin, dan aktivitasnya sedang apa. Setelah di gambar di kertas, silahkan di upload ke sini. NB: kertas folio dengan posisi kertas <b>PORTRAIT</b>. Gambar mengunakan <b>PENSIL</b>',82,1,'-','-','-','-','-','-',2,1,1,'2022-04-09 17:13:02','2022-04-09 17:13:02'),
(2367,'Silahkan gambar pohon yang bisa dipanjat dan pohonnya harus bercabang. Nama-nama yang disebutkan di bawah ini <b>TIDAK BOLEH DIGAMBAR</b>: beringin, cemara / pinus, kelapa, pisang, pepaya, randu, perdu, bambu, bunga. Tugas Anda adalah menggambar pohon yang bisa dipanjat dan pohonnya harus bercabang. Setelah digambar, berikan keterangan itu gambar pohon apa. NB: kertas folio dengan posisi kertas <b>PORTRAIT</b>. Gambar mengunakan <b>PENSIL</b>',83,1,'-','-','-','-','-','-',2,1,1,'2022-04-09 17:13:13','2022-04-09 17:13:13'),
(2368,'Di lembar berikutnya ini, tugas Anda menggambar rumah, orang dan pohon. Terserah letaknya bagaimana, asalkan dalam 1 kertas muat 3 gambar tersebut. NB: kertas folio posisi <b>LANDSCAPE</b>. Gambarlah menggunakan <b>PENSIL</b> Setelah di gambar di kertas, silahkan di upload ke sini.',84,1,'-','-','-','-','-','-',2,1,1,'2022-04-09 17:13:21','2022-04-09 17:13:21'),
(2369,'Unduh dan cetaklah file template dibawah ini. Nanti di sini sudah terdapat 8 kotak. Di tiap kotak sudah terdapat gambarnya masing-masing. Tugas Anda adalah melanjutkan gambar tersebut. Terserah mau menggambar apa, gambar yang terlintas di pikiran pertama kali itu saja yang di gambar. Cara mengerjakannya, boleh dimulai dari kotak manapun asalkan ditulis nomor pengerjaannya. Yang pertama diberi no 1, no 2 dan seterusnya sampai nomer ke 8. Setelah semuanya selesai di gambar, berilah keterangan di lembar putih di bawah gambar no 1-8 itu gambar apa. Setelah itu pilihlah 1 gambar yang paling disukai, 1 gambar yang paling tidak disukai, 1 gambar yang paling mudah, dan 1 gambar yang paling susah. NB: Gambar Menggunakan <b>PENSIL</b> Setelah di gambar di kertas, silahkan di upload ke sini.',85,1,'-','-','-','-','-','-',2,1,1,'2022-04-09 17:13:29','2022-04-09 17:13:29');
